import React from 'react';
import { ListGroup } from 'react-bootstrap';

const NestedList = ({ items, level = 0 }) => {
    if (!items) {
        return null;
    }

    const getIndentClass = (level) => {
        return `list-group-item-indent-${level}`
    }

    return (
        <ListGroup>
            {items.map((item) => (
                <ListGroup.Item
                    key={item.key}
                    action
                    className={`list-group-item-light  cursor-pointer ${getIndentClass(level)}`}
                >
                    {item.label}
                    {item.children && (
                        <NestedList items={item.children} level={level + 1} />
                    )}
                </ListGroup.Item>
            ))}
        </ListGroup>
    );
};

export default NestedList;
